import React from 'react'
import PropTypes from 'prop-types'


const Title = ({title}) => {
   return (
      <h1 className='navbar bg-dark'>
        <i className={icon} /> {title}
      </h1>
  )
}

Title.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Title
